const NUMBERS = [
    '1', '2', '3', '4', '5', '6', '7', '8', '9', '0'
];
class PostfixEquation {
    constructor(infix) {
        this.infix = infix;
        this.priority0 = [
            '+', '-'
        ]
        this.priority1 = [
            '*', '/'
        ]
        this.priority2 = [
            '%'
        ]
        this.tempStack = [];
        this.outputStack = [];
    }

    findCompareValue(x){
        if(this.priority0.includes(x)){
            return 0;
        }
        else if(this.priority1.includes(x)){
            return 1;
        }
        else if(this.priority2.includes(x)){
            return 2;
        }
    }

    covertToEquation() {
        const variab = this.infix.map((individualElem) => {
            if (NUMBERS.includes(individualElem)) {
                this.outputStack.push(individualElem);
            }
        });
        console.log(this.outputStack)
    }
}

export default PostfixEquation;
